import React from "react";

const welcome = {
    border: "2px solid red",
    color: "red"
}

export default class Title extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return <div style={welcome}>Welcome to React Quiz!</div>
    }
}
